import React from "react";
import "./Project.css";

function Project({ project }) {
  return (
    <div
      className="project"
      style={{ backgroundImage: `url(${project.imageUrl})` }}
      onMouseEnter={() => setBcgImg}
    >
      <div className="project-banner"></div>
    </div>
  );
}

export default Project;
